struct TEST_DATA//定义结构体，用于存储数据
{
	INT32 test_buffer[LoadSize];

};
void Initial_Test_Data(TEST_DATA *td,INT32 test_data[],int circle) //初始化结构体
{
	if (td == NULL)
	{
		cout << "error:结构体为空!" << endl;
		return;
	}
	for (int i = 0; i < LoadSize; i++)
	{
		td->test_buffer[i] = test_data[circle*302+i];
		//cout << td->test_buffer[i] << endl;
	}
	return;
}
void UDP_sender()
{
	WSADATA wsaData;
	SOCKET SendingSocket;
	SOCKADDR_IN ReceiverAddr;
	int ReceiverAddrsize = sizeof(ReceiverAddr);
	int Port = PortNum;
	char buffer[1400] = "\0";
	/*if (argc <= 1)
	{
	printf("USAGE:UDPSender< receiver IP address>\n");
	system("pause");
	return;
	}*/
	WSAStartup(MAKEWORD(2, 2), &wsaData);
	SendingSocket = socket(AF_INET, SOCK_DGRAM, IPPROTO_UDP);
	//接收端地址
	ReceiverAddr.sin_family = AF_INET;
	ReceiverAddr.sin_port = htons(Port);
	//ReceiverAddr.sin_addr.S_un.S_addr = inet_addr("10.179.5.104");
	ReceiverAddr.sin_addr.S_un.S_addr = inet_addr("127.0.0.1");

	TEST_DATA td;
	int countT = 0;//统计发了几包数据
	while (countT<45)
	{//char* buffer = (char*)Data;
		Initial_Test_Data(&td, test_data, countT);
		memcpy(&buffer, &td, sizeof(TEST_DATA));//把结构体拷贝到char数组中
		if (sendto(SendingSocket, buffer, sizeof(TEST_DATA), 0, (SOCKADDR*)&ReceiverAddr, sizeof(ReceiverAddr)) != SOCKET_ERROR)
		{
			cout << "send to buffer successfully!,countTime is:" << countT<<endl;

		}
		Sleep(200);
		countT++;
	}
	closesocket(SendingSocket);
	WSACleanup();
	return;
}

int main()
{
	
	UDP_sender();
	
	system("pause");
	return 0;
}